  <script>
    let ary = [11, 13, 14, 12, 11, 14, 12, 13, 11]
    function unquie(ary) {
      for (var i = 0; i < ary.length; i++) {
        var cur = ary[i];
        for (var j = i + 1; j < ary.length; j++) {
          var next = ary[j];
          if (cur === next) {
            ary.splice(j, 1);
            j--;
          }
        }
      }
      return ary;
    }
    console.log(unquie(ary))
  </script>
